// eslint-disable-next-line prettier/prettier
import React, {
  Component
} from 'react';

// eslint-disable-next-line prettier/prettier
import {
  View,
  Text,
  StyleSheet,
  Image
} from 'react-native';

export default class App extends Component<{}> {
  foo() {
    alert('圖片載入完畢!')
  }

  render() {
    return (
      <View>
        {/* 用來引入圖片的組件 */}
        {/* 如果要引入項目文件夾中的資源圖片，需要用require */}
        <Image source={require('./img/RNICON.png')}
          style={{ width: 200, height: 150 }}

          // 定義圖片縮放(列舉值)
          resizeMode='stretch'

          //匿名函數
          onLoad={() => alert('圖片載入完畢!')}
        >
        </Image>

        {/* 引入網路圖片 */}
        {/* IOS中只支持https協議的圖片 */}
        {/* 引入的網路圖片必須指定寬高 */}
        <Image
          source={{ uri: 'http://www.appcoda.com/wp-content/uploads/2015/04/react-native.png' }}
          style={{ width: 150, height: 150 }}
          
          //事件被觸發時會調用綁定的函數，所以寫的是函數名(函數聲明)
          onLoad={this.foo}>          
        </Image>

        {/* 引入base64編碼的圖片 */}
        <Image
          source={{
            uri: 'data:image/png;base64,'
          }}
          style={{ width: 150, height: 150 }}>
        </Image>
      </View >
    );
  }
}